import React from 'react';
import './Skills.css'; // Assurez-vous de créer ce fichier CSS pour le style

function Skills() {
  return (
    <div className="skills-container">
      <h1>Skills</h1>
      <div className="skill-thumbnail">
        <div className="thumbnail-image">
          <img src="url_de_votre_image" alt="Titre de votre compétence" />
        </div>
        <div className="skill-details">
          <h2>Nom de la compétence</h2>
          <p>Description de la compétence</p>
        </div>
      </div>
    </div>
  );
}

export default Skills;
